import React, {Component} from 'react';
import './App.css';

//This is a component that is used to render the Header of the app.

class Header extends Component{
	render() {
		return(
		<div>
		<h1> <center>Welcome back to your favourite shopping website :)</center></h1>
		<p1> <center>Feel free to filter to your favourite pieces by type of clothing or by occasion! You can also sort through the clothes according to price.</center> </p1>
		</div>
		)
	}
}

export default Header;
